import React from "react";
import { Bar } from "react-chartjs-2";
import chartDatajson from "./data/jsondata.json";

let chartData = {
  datasets: chartDatajson,
};
const DataChart = () => {
  console.log(chartData);
  return (
    <div>
      <h2>Data Visualization</h2>
      <Bar data={chartData} />
    </div>
  );
};

export default DataChart;
